import React, { Component } from 'react'
import{Row,Col} from 'antd'
class Footer extends Component {
    render() {
        return (
        <div className="foot">
        <Col lg={{span:22,offset:2}}>
            <footer>
                <h3>ที่อยู่:</h3>
                <h3>fb:</h3>
                <h3>line:</h3>
                <h3>page:</h3>
            </footer>
            </Col>
        </div>)
    }
}
export default Footer;
